sys_variable_value.value:
(function execute(inputs, outputs) {
    var utils = new OciObjectStorageManagementUtils();
    utils.validateInputVariables(inputs, outputs);
  	utils.validateMandatoryVariables(inputs,["namespace","bucketname","objectname"]);
    utils.maptoOutputFromInput(inputs, outputs, ["namespace","bucketname","objectname"]);
  })(inputs, outputs);

